import ExpenseItem from './ExpenseItem';

const ExpensesList = props => {
  let expensesContent = <p>No Expenses Found.</p>;

	if (props.items.length > 0) {
		expensesContent  = filteredExpenses.map((element) => {
			return (
				<ExpenseItem
					key={element.id}
					title={element.title}
					amount={element.amount}
					date={element.date}
				/>
			);
		})
	}
};

